import {makeAutoObservable} from "mobx"

class Store{
    count=0;
    constructor() {
        makeAutoObservable(this);
    }
    increment () {
        this.count=this.count +1
        console.log(this.count)
    }
    decrement() {
        this.count=this.count -1

    }
}

export default new Store();
